  false,\n\t\"url\": null,\n\t\"notes\": \"The goal of the first phase of this study
  is to obtain baseline data on sandhill crane numbers, breeding population, distribution,
  home range, nesting ecology, and habitat ecology at KMNWR. More specific objectives
  of the first phase of research include:  1. Determine overall crane population size,
  and number of  breeding adults, at the Refuge.  2. Quantify nesting success and
  juvenile recruitment.  3. Quantify water depth and vegetative characteristics at
  \ crane nest sites.  4. Identify and evaluate crane roosting and colt rearing  areas
  on the Refuge.  5. Evaluate crane use of different vegetation communities  within
  their home range relative to availability.  6. Utilize information gathered in this
  first phase to  develop a replicated sampling design to test hypotheses about  crane
  response to Refuge land management practices.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
